import React from 'react';
import CanvasDraw from "react-canvas-draw";

const Header = props => {

	return(

		<div className="flex  mv3 ">
			<div className="">Logo</div>
			<div className="flex mv3">
			<span className="br4 ba ph4 pv2 mr3 pointer b--light-red light-red">Alphabets</span>
			<span className="br4 ba ph4 pv2 pointer b--light-red light-red">Digit</span>
		</div>
			<div className="center flex br-pill ba b--blue ">
				<span className={`br--right3 pv2 ph4 pointer  ${props.type==='learn'?'bg-blue white':'blue'} `} data-type="learn" onClick={props.handleType}>Learn</span>
				<span className={`br--left3 pv2 ph4 pointer ${props.type==='test'?'bg-blue white':'blue'} `} data-type="test" onClick={props.handleType}>Test</span>
			</div>	
		</div>


	)
}



export default Header;
